import { createContext, useReducer } from "react"
import Gallary from "./Gallary"
import Product from "./Product"

const allData = {
    gallary: ['A', 'B', 'C', 'D'],
    product: ['E', 'F', 'G', 'H'],
}
export const globalContaxt = createContext()

const parentReducer = (state, action) => {
    if (action.type === 'CHENGE_TITLE') {
             return { ...state, title: action.paylode }
           }
           else {
             return state
           }
}

function Main() {
    const [state, dispatch] = useReducer(parentReducer, allData)
    return (
        <div>
            <globalContaxt.Provider value={state}>
                <Gallary />
                <Product />
            </globalContaxt.Provider>

        </div>
    )
}
export default Main
